import { 
  Histogram, 
  XAxis, 
  YAxis, 
  CartesianGrid, 
  Tooltip, 
  ResponsiveContainer } from 'recharts';

function HistogramChart() {
  return (
    <ResponsiveContainer width="100%" height={400}>
      <Histogram
        data={data}
        dataKey="ATK"
        stroke="#8884d8"
        fill="#8884d8"
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="ATK" />
        <YAxis />
        <Tooltip />
      </Histogram>
    </ResponsiveContainer>
  );
}

export default HistogramChart;
